import * as api from '../api/AuthApi'

export const register = (login,full_name,passwprd,email) => async(dispatch) => {
    try {
        const {data} = await api.registerUser(login,full_name,passwprd,email)
        dispatch({type:'register', payload: data})   

    } catch (error) {
        console.log(error);
    }

}
